package com.sina.parkingManagement.model;import com.sina.parkingManagement.common.baseModel.BaseEntity;import lombok.Data;import lombok.EqualsAndHashCode;import lombok.ToString;import javax.persistence.*;import java.util.List;@Entity@Data@Table(name = Vehicle.VEHICLE_TBL)public class Vehicle extends BaseEntity {    public static final String VEHICLE_TBL = "vehicle_tbl";    @Column(unique = true)    private String plateNumber;    @Enumerated(value = EnumType.STRING)    private VehicleType vehicleType;    @ToString.Exclude    @EqualsAndHashCode.Exclude    @OneToMany(mappedBy = "vehicle", fetch = FetchType.LAZY, cascade = CascadeType.ALL)    private List<ParkingDetails> parkingDetails;}